import React from 'react';
import { Form } from 'antd';
const Register = () => {
	return (
		<div className="h-screen">
			<Form layout="vertical">
				<Form.Item label="Name">
					<input type="text" />
				</Form.Item>

				<Form.Item label="E-mail">
					<input type="text" />
				</Form.Item>

				<Form.Item label="Password">
					<input type="text" />
				</Form.Item>
			</Form>
		</div>
	);
};

export default Register;
